    inverseViewMatrix[3][0] = 0.0;//worldMatrix[3][0];
    inverseViewMatrix[3][1] = 0.0;//worldMatrix[3][1];
    inverseViewMatrix[3][2] = 0.0;//worldMatrix[3][2];
